          easing: "ease-in-out",
          once: true,
          offset: 100,
          delay: 0,
        });
      }
    };

    // Wait for AOS to load
    if (window.AOS) {
      initAOS();
    } else {
      const checkAOS = setInterval(() => {
        if (window.AOS) {
          initAOS();
          clearInterval(checkAOS);
        }
      }, 100);
    }

